import React, { useEffect } from 'react';
import axios from "axios";


function Home() {
  React.useEffect(() => {
    getProducts()
  }) //posso passar um parametro que faz com que a funçao dispare assim que a funçao mudar de valor 

  function getProducts() {
    const url = "http://localhost:3000/api/products.js";
    axios.get(url)
  }

  return (
    <>Home</>
  )
}
export default Home;
